{% extends 'temporary/base.html' %}

{% load staticfiles %}

{% block scripts %}
{% endblock %}

{% block content %}
{% if object_list %}
	<table>
	{% for obj in object_list %}
		<tr>
			<td>{{ obj }}</td>
		</tr>
	{% endfor %}
	</table>
{% else %}
	<p>List has no members.</p>
{% endif %}
{% endblock %}
